// src/Navbar.js
import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Import the CSS file

const Navbar = () => {
    return (
        <AppBar position="static" style={{ backgroundColor: '#003366' }}> {/* Deep blue background */}
            <Toolbar>
                <Typography variant="h6" style={{ flexGrow: 1, color: '#FFD700' }}>
                    POS Portal
                </Typography>
                <Button 
                    className="nav-button" 
                    color="inherit" 
                    component={Link} 
                    to="/dashboard"
                    size="large"
                >
                    Dashboard
                </Button>
                <Button 
                    className="nav-button" 
                    color="inherit" 
                    component={Link} 
                    to="/inventory"
                    size="large"
                >
                    Inventory
                </Button>
                <Button 
                    className="nav-button" 
                    color="inherit" 
                    component={Link} 
                    to="/barcode-selector"
                    size="large"
                >
                    Barcode Selector
                </Button>
            </Toolbar>
        </AppBar>
    );
};

export default Navbar;
